import React from 'react';
import {Text, View, StyleSheet, TouchableOpacity} from 'react-native';

export default function Home(){
    return(
    <View>
        <TouchableOpacity
        onPress={navigation.navigate('Det')}>
            <Text>Home</Text>
        </TouchableOpacity>
    </View>
    )
}
